// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import './App.css';

function Navigation() {
  return (
    <div className="side-nav">
      <div className="logo">
        <img src="/images/logo.png" className="logo-img" alt="Logo" />
      </div>
      <ul>
        <li><img src="./images/profile.png" alt="Profile"/><p>Profile</p></li>
        <li><img src="/images/charts.png" alt="Charts"/><p>Charts</p></li>
        <li><img src="/images/schools.png" alt="Schools"/><p>Schools</p></li>
        <li><img src="/images/clubs.png" alt="Clubs"/><p>Clubs</p></li>
      </ul>
      <ul>
        <li><img src="/images/logout.png" alt="Logout"/><p>Logout</p></li>
      </ul>
    </div>
  );
}

function SignUpLogin() {
  return (
    <div className="signup-login">
      <Link to="/signup"><button>Sign Up</button></Link>
      <Link to="/login"><button>Login</button></Link>
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <h1>ProJect GraPhiNg</h1>
    </div>
  );
}

function SignUp() {
  return (
    <div>
      {/* Sign Up Form */}
      <div className="logo-container">
        <a href="home.html" className="logo-link"> 
          <img src="Images/logo.png" alt="Logo" className="logo-img" />
        </a>
        <p className="logo-text">ProJect GraPhiNg</p>
      </div>

      {/* Sign Up Form */}
      <div className="container">
        <div className="form-container">
          <form id="signup" action="">
            <fieldset>
              <legend>Sign Up</legend>

              <br></br>
              <p>Have an account? <a href="login.html" className="button">Log In</a></p>
              <br></br>

              <label htmlFor="email">Email:</label><br />
              <input type="text" id="email" name="email" /><br />

              <label htmlFor="password">Password:</label><br />
              <input type="password" id="password" name="password" /><br />
            </fieldset>
            
            <br></br>
            <input type="submit" value="Sign Up" className="button" />
          </form>    
          <br></br>
          <p>By creating an account, you are agreeing to ProJect GraPhiNg's <a href="tos.html" className="link"><b>Terms of Service</b></a> and <a href="priv.html" className="link"><b>Privacy Policy.</b></a></p>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <div>
      <Navigation />
      <SignUpLogin />
      <Header />
    </div>
  );
}

export default App;
